apiVersion: operators.coreos.com/v1alpha1
kind: ClusterServiceVersion
metadata:
  name: atsgen-tf-operator.v0.0.1
  namespace: placeholder
  annotations:
    alm-examples: |-
      [
         {
            "apiVersion": "tungsten.atsgen.com/v1alpha1",
            "kind": "SDN",
            "metadata": {
               "name": "default"
            },
            "spec": {
               "datapathConfig": {
                  "useVrouter": true
               }
            }
         }]
    categories: Networking
    certified: 'false'
    createdAt: '2020-06-30T12:00:00Z'
    description: >-
      Atsgen Tungsten Fabric Operator for lifecycle management of Tungsten Fabric SDN
    containerImage: 'registry.connect.redhat.com/atsgen/tf-operator:v0.0.1'
    support: 'tungsten-vpp@atsgen.com'
    capabilities: Seamless Upgrades
    repository: 'https://github.com/atsgen'
    marketplace.openshift.io/remote-workflow: "https://atsgen.com/tungsten/openshift-installation/"
    marketplace.openshift.io/action-text: "Install-time Instructions"
spec:
  displayName: ATSgen Tungsten Fabric Operator
  description: >
    ## About the managed application

    Tungsten Fabric is a software-defined network and security fabric built for
    rapid deployment at scale. It provides a highly scalable virtual networking
    and security platform that works with a variety of virtual machine and
    container orchestrators, integrating them with physical networking and
    compute infrastructure. It is designed to support multi-tenant networks in
    the largest environments while supporting multiple orchestrators
    simultaneously.


    Tungsten Fabric enables usage of the same controller and forwarding
    components for every deployment, providing a consistent interface for
    managing connectivity in all the environments it supports, and is able to
    provide seamless connectivity between workloads managed by different
    orchestrators, whether virtual machines or containers, and to destinations
    in external networks.

    ## About this Operator

    Tungsten Fabric Operators is intended to simplify the lifecycle management
    of Tungsten Fabric SDN

    ## Prerequisites for enabling this Operator
  maturity: beta
  version: 0.0.1
  replaces: ''
  skips: []
  minKubeVersion: 1.12.9
  keywords:
    - Tungsten
    - Tungsten Fabric
    - TungstenFabric
    - SDN
    - CNI
    - ATS
    - Atsgen
    - AtsgenTungsten
  maintainers:
    - name: support
      email: tungsten-vpp@atsgen.com
  provider:
    name: Atsgen
  labels: {}
  selector:
    matchLabels: {}
  links:
    - name: website
      url: 'https://atsgen.com'
  icon:
    - base64data: >-
        
      mediatype: image/png
  customresourcedefinitions:
    owned:
      - name: sdns.tungsten.atsgen.com
        displayName: SDN
        kind: SDN
        version: v1alpha1
        description: SDN
        resources:
          - version: v1
            kind: Deployment
          - version: v1
            kind: Service
          - version: v1
            kind: ReplicaSet
          - version: v1
            kind: Pod
          - version: v1
            kind: Secret
          - version: v1
            kind: ConfigMap
        specDescriptors:
          - path: adminSecretRef
            description: Admin Secret Ref
            displayName: Admin Secret Ref
            x-descriptors: []
          - path: cniConfig
            description: Cni Config
            displayName: Cni Config
            x-descriptors: []
          - path: datapathConfig
            description: Datapath Config
            displayName: Datapath Config
            x-descriptors: []
          - path: releaseTag
            description: Release Tag
            displayName: Release Tag
            x-descriptors: []
        statusDescriptors:
          - path: controllers
            description: Controllers
            displayName: Controllers
            x-descriptors: []
          - path: error
            description: Error
            displayName: Error
            x-descriptors: []
          - path: releaseTag
            description: Release Tag
            displayName: Release Tag
            x-descriptors: []
          - path: stage
            description: Stage
            displayName: Stage
            x-descriptors: []
          - path: state
            description: State
            displayName: State
            x-descriptors: []
    required: []
  install:
    strategy: deployment
    spec:
      permissions: []
      clusterPermissions:
        - serviceAccountName: tf-operator
          rules:
            - apiGroups:
                - ''
              resources:
                - configmaps
                - endpoints
                - events
                - namespaces
                - nodes
                - persistentvolumeclaims
                - pods
                - secrets
                - serviceaccounts
                - services
                - services/finalizers
              verbs:
                - create
                - delete
                - get
                - list
                - patch
                - update
                - watch
            - apiGroups:
                - extensions
              resources:
                - ingresses
                - networkpolicies
              verbs:
                - get
                - list
                - patch
                - update
                - watch
            - apiGroups:
                - apiextensions.k8s.io
              resources:
                - customresourcedefinitions
              verbs:
                - create
                - get
            - apiGroups:
                - k8s.cni.cncf.io
              resources:
                - network-attachment-definitions
              verbs:
                - '*'
            - apiGroups:
                - security.openshift.io
              resources:
                - securitycontextconstraints
              verbs:
                - use
              resourceNames:
                - privileged
            - apiGroups:
                - config.openshift.io
              resources:
                - networks
              verbs:
                - get
                - list
                - patch
                - update
                - watch
            - apiGroups:
                - operator.openshift.io
              resources:
                - networks
              verbs:
                - get
                - list
                - watch
            - apiGroups:
                - ''
              resources:
                - networks
              verbs:
                - get
                - patch
                - update
            - apiGroups:
                - rbac.authorization.k8s.io
              resources:
                - clusterrolebindings
                - clusterroles
              verbs:
                - create
                - delete
                - get
                - list
                - patch
                - update
                - watch
            - apiGroups:
                - apps
              resources:
                - deployments
                - daemonsets
                - replicasets
                - statefulsets
              verbs:
                - create
                - delete
                - get
                - list
                - patch
                - update
                - watch
            - apiGroups:
                - monitoring.coreos.com
              resources:
                - servicemonitors
              verbs:
                - get
                - create
            - apiGroups:
                - apps
              resourceNames:
                - tf-operator
              resources:
                - deployments/finalizers
              verbs:
                - update
            - apiGroups:
                - tungsten.atsgen.com
              resources:
                - '*'
              verbs:
                - create
                - delete
                - get
                - list
                - patch
                - update
                - watch
      deployments:
        - name: tf-operator
          spec:
            replicas: 1
            selector:
              matchLabels:
                name: tf-operator
            template:
              metadata:
                labels:
                  name: tf-operator
              spec:
                hostNetwork: true
                serviceAccountName: tf-operator
                containers:
                  - name: tf-operator
                    image: 'registry.connect.redhat.com/atsgen/tf-operator:v0.0.1'
                    command:
                      - tf-operator
                      - '--url-only-kubeconfig=/etc/kubernetes/kubeconfig'
                    imagePullPolicy: IfNotPresent
                    env:
                      - name: K8S_PROVIDER
                        value: OpenShift
                      - name: CONTAINER_REGISTRY
                        value: "registry.connect.redhat.com/atsgen"
                      - name: WATCH_NAMESPACE
                        value: ''
                      - name: POD_NAME
                        valueFrom:
                          fieldRef:
                            fieldPath: metadata.name
                      - name: OPERATOR_NAMESPACE
                        valueFrom:
                          fieldRef:
                            fieldPath: metadata.namespace
                      - name: OPERATOR_NAME
                        value: tf-operator
                    volumeMounts:
                      - mountPath: /etc/kubernetes/kubeconfig
                        name: host-kubeconfig
                        readOnly: true
                affinity:
                  nodeAffinity:
                    requiredDuringSchedulingIgnoredDuringExecution:
                      nodeSelectorTerms:
                        - matchExpressions:
                            - key: node-role.kubernetes.io/master
                              operator: Exists
                priorityClassName: system-cluster-critical
                tolerations:
                  - key: node-role.kubernetes.io/master
                    operator: Exists
                    effect: NoSchedule
                  - key: node.kubernetes.io/not-ready
                    operator: Exists
                    effect: NoSchedule
                volumes:
                  - name: host-kubeconfig
                    hostPath:
                      path: /etc/kubernetes/kubeconfig
  installModes:
    - type: OwnNamespace
      supported: true
    - type: SingleNamespace
      supported: true
    - type: MultiNamespace
      supported: false
    - type: AllNamespaces
      supported: false
